  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ninepipe
  National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
  year. The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses compliance with environmental
  and cultural resource mandates. Refuge administration is outlined; information about
  volunteer programs is given. Habitat management is also covered; subjects include
  wetlands, grasslands, other habitats, grazing, and pest control. The wildlife section
  of the report discusses wildlife diversity, endangered and threatened species, waterfowl,
  marsh birds and waterbirds, shorebirds, raptors, other resident wildlife, and fisheries
  resources. The public uses of the Refuge described in this report include outdoor
  classrooms, interpretive programs, hunting, fishing, wildlife observation, other
  wildlife oriented recreation, picnicking, and law enforcement. The equipment and
  facilities section of the report provides information about maintenance. Refuge
  brochures and field guides are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
